cy.request({
    method: "GET",
    url: apiMenu_HLs_1.default.url,
    headers: {
        Authorization: "Bearer ".concat(accessToken_data.accessToken)
    },
    qs: {
        language: "vi"
    }
}).then(function (response) {
    //assert status response
    expect(response.status).eq(200);
    //assert number of category response
    // cy.log(response.body.MenusItem[0].Item)
    var count_category_item = (response.body.MenusItem[0].Item).length;
    expect(count_category_item).eq(apiMenu_HLs_1.default.category.length);
    //assert list category
    // cy.log(count_category_item)
    for (var i = 0; i < count_category_item; i++) {
        // cy.log(response.body.MenusItem[0].Item[i].Title)
        expect(response.body.MenusItem[0].Item[i].Title).eq(apiMenu_HLs_1.default.category[i]);
    }
    var isValidResponse = ajv.validate(responseSchema, response.body);
    // Assert that the response matches the schema
    expect(isValidResponse, ajv.errorsText(ajv.errors)).to.be.true;
});

